(function(){
	const did = (date = Date.now()) =>
	{
		if (typeof date !== 'number') throw new Error('Date must be type of number')
		
		const ts = i => i.toString(16)
		const ss = i => i.slice(0, 16)
		const tu = i => i.toUpperCase()
		const ra = i => Math.floor(1 + Math.random() * i)
		const rc = () => tu(ts(ra(0xF)))
		
		const mp = function ()
		{
			const args=[].slice.call(arguments)
			var n = 1
			args.map(i=>n*=i)
			return n
		}
		
		var nr =
		[ ra(0x1), ra(0x10), ra(0x100), ra(0x1000),
			ra(0x2), ra(0x20), ra(0x200), ra(0x2000),
			ra(0x3), ra(0x30), ra(0x300), ra(0x3000),
			ra(0x4), ra(0x40), ra(0x400), ra(0x4000) ]
		
		var ms = date
			+ ( nr[0] * nr[4] * nr[8] - nr[2] )
			* ( nr[15] + nr[14] - nr[10] * nr[5] )
			* ( nr[0] * nr[1] * nr[2] * nr[3] * nr[4] )
		
		ms = Math.floor(ms)
		ms = ts(ms)
		if (ms[0] === '-') ms = ms.substring(1)
		ms = tu(ms)
		while (ms.length < 16) ms += rc()
		ms = ss(ms)
		return ms
	}
	
	if ((typeof __filename === "undefined" || __filename === null) || (typeof __dirname === "undefined" || __dirname === null) || (typeof module === "undefined" || module === null) || (typeof require === "undefined" || require === null) || (typeof exports === "undefined" || exports === null) || typeof __filename !== "string" || typeof __dirname !== "string" || typeof exports !== "object" || typeof module !== "object" || module.constructor.name !== "Module") {
		return window.did = did
	} else {
		return module.exports = did
	}
})()